import Todos from './components/Todos';
import Todo from './models/todo';

function App() {
    const todosOb: Todo[] = [
        { id: 'm1', text: 'LearnReact' },
        { id: 'm2', text: 'LearnTS' },
    ];

    return (
        <div>
            <Todos items={todosOb} />
        </div>
    );
}

export default App;
